import React, { useState, useRef } from 'react';
import { Link } from 'react-router-dom';
import '../styles/Fitnes1.css';
import { HomeOutlined, DashboardOutlined, CalendarOutlined, UserOutlined } from '@ant-design/icons';
import axios from 'axios';

const Fitnes1 = () => {
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);
  const [isCameraOpen, setIsCameraOpen] = useState(false);
  const [isComplete, setIsComplete] = useState(false);
  const iframeRef = useRef(null);

  const toggleSidebar = () => {
    setIsSidebarOpen(!isSidebarOpen);
  };

  const startCamera = async () => {
    try {
      console.log("Starting camera. Redirecting to: http://127.0.0.1:5000/");
      window.location.href = 'http://127.0.0.1:5000/';
    } catch (error) {
      console.error("Error during startCamera:", error);
      alert("カメラの起動中にエラーが発生しました。コンソールを確認してください。");
    }
  };

  const stopCamera = async () => {
    setIsCameraOpen(false);
    if (iframeRef.current) {
      iframeRef.current.src = '';
    }
    try {
      const response = await axios.post('http://127.0.0.1:5000/stop_video');
      console.log('Video stopped', response.data);
    } catch (error) {
      console.error('Error stopping video:', error.response ? error.response.data : error.message);
      alert('ビデオ停止中にエラーが発生しました。');
    }
  };

  const saveSessionData = async () => {
    try {
      console.log('Sending request to save session data...');
      const response = await axios.post('http://127.0.0.1:5000/stop_and_save');
      console.log('Session data saved:', response.data);
      alert('セッションデータが保存されました。');
    } catch (error) {
      console.error('Error saving session data:', error.response ? error.response.data : error.message);
      alert('セッションデータの保存中にエラーが発生しました。');
    }
  };

  const handleMessage = (event) => {
    if (event.data === 'COMPLETE') {
      setIsComplete(true);
      stopCamera();
    }
  };

  React.useEffect(() => {
    window.addEventListener('message', handleMessage);
    return () => {
      window.removeEventListener('message', handleMessage);
    };
  }, []);

  return (
    <div className="dashboard">
      <div className={`sidebar ${isSidebarOpen ? 'open' : ''}`}>
        <div className="sidebar-toggle" onClick={toggleSidebar}>
          {isSidebarOpen ? '❌' : '☰'}
        </div>
        <ul>
          <li>
            <Link to="/home">
              <HomeOutlined />
              <span>Home</span>
            </Link>
          </li>
          <li>
            <Link to="/dashboard">
              <DashboardOutlined />
              <span>Dashboard</span>
            </Link>
          </li>
          <li>
            <Link to="/calendar">
              <CalendarOutlined />
              <span>Calendar</span>
            </Link>
          </li>
          <li>
            <Link to="/profile">
              <UserOutlined />
              <span>Profile</span>
            </Link>
          </li>
        </ul>
      </div>
      <div className="content">
        <h1>Fitness1</h1>
        <div className="actions">
          <button onClick={startCamera} disabled={isCameraOpen || isComplete}>
            撮影を開始する
          </button>
          <button onClick={stopCamera} disabled={!isCameraOpen || isComplete}>
            撮影を停止する
          </button>
          <button onClick={saveSessionData} disabled={!isComplete}>
            セッションデータを保存する
          </button>
        </div>
        <iframe ref={iframeRef} src={isCameraOpen ? 'http://127.0.0.1:5000/video_feed' : ''} width="600" height="400" title="Camera Feed" />
      </div>
    </div>
  );
};

export default Fitnes1;
